import React from 'react';

function Main(props) {
    return (
        <main className="main page__main">
            <section className="profile main__profile">
                <div onClick={props.onEditAvatar} className="profile__wrapper">
                    <img
                        className="profile__avatar"
                        src="<%=require('../images/Jacques-Yves-Cousteau.png')%>"
                        alt="Аватар профиля."
                    />
                </div>
                <div className="profile__info">
                    <h1 className="profile__name">Жак-Ив Кусто</h1>
                    <button onClick={props.onEditProfile} className="profile__edit-button" type="button" />
                    <h2 className="profile__description">Исследователь океана</h2>
                </div>
                <button onClick={handleAddPlaceClick} className="profile__add-button" type="button" />
            </section>
            <section className="main__gallery">
                <ul className="gallery"></ul>
            </section>
        </main>
    )





 function handleAddPlaceClick() {
    const addCardPopup = document.querySelector('.popup-add-card');
    addCardPopup.classList.add('popup_is-opened');

  }
}

export default Main
